import React, { useEffect, useState } from 'react';
import axios from 'axios';

function AdminDashboard() {
  const [users, setUsers] = useState([]);
  const [jobs, setJobs] = useState([]);

  const [userSearch, setUserSearch] = useState('');
  const [jobSearch, setJobSearch] = useState('');

  const loadData = async () => {
    const [userRes, jobRes] = await Promise.all([
      axios.get('/api/admin/users'),
      axios.get('/api/admin/jobs')
    ]);
    setUsers(userRes.data);
    setJobs(jobRes.data);
  };

  const deleteUser = async (id) => {
    await axios.delete(`/api/admin/users/${id}`);
    loadData();
  };

  const deleteJob = async (id) => {
    await axios.delete(`/api/admin/jobs/${id}`);
    loadData();
  };

  useEffect(() => {
    loadData();
  }, []);

  // Filtered Data
  const filteredUsers = users.filter(u =>
    u.username.toLowerCase().includes(userSearch.toLowerCase()) ||
    u.role.toLowerCase().includes(userSearch.toLowerCase())
  );

  const filteredJobs = jobs.filter(j =>
    j.title.toLowerCase().includes(jobSearch.toLowerCase()) ||
    j.location.toLowerCase().includes(jobSearch.toLowerCase()) ||
    j.postedBy.toLowerCase().includes(jobSearch.toLowerCase())
  );

  return (
    <div>
      <h3>Admin Dashboard</h3>

      <h4>👥 Users</h4>
      <input
        type="text"
        placeholder="Search by username or role..."
        value={userSearch}
        onChange={e => setUserSearch(e.target.value)}
      />
      <table border="1">
        <thead>
          <tr>
            <th>ID</th><th>Username</th><th>Role</th><th>Action</th>
          </tr>
        </thead>
        <tbody>
          {filteredUsers.map(u => (
            <tr key={u.id}>
              <td>{u.id}</td><td>{u.username}</td><td>{u.role}</td>
              <td><button onClick={() => deleteUser(u.id)}>Delete</button></td>
            </tr>
          ))}
        </tbody>
      </table>

      <h4>💼 Jobs</h4>
      <input
        type="text"
        placeholder="Search by title, location, or postedBy..."
        value={jobSearch}
        onChange={e => setJobSearch(e.target.value)}
      />
      <table border="1">
        <thead>
          <tr>
            <th>ID</th><th>Title</th><th>Location</th><th>Posted By</th><th>Action</th>
          </tr>
        </thead>
        <tbody>
          {filteredJobs.map(j => (
            <tr key={j.id}>
              <td>{j.id}</td><td>{j.title}</td><td>{j.location}</td><td>{j.postedBy}</td>
              <td><button onClick={() => deleteJob(j.id)}>Delete</button></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AdminDashboard;
